import { useEffect, createContext } from 'react'
import axios from 'axios';

const DentistState = createContext();

const Context = () => {
    
    const url = 'https://jsonplaceholder.typicode.com/users'

    useEffect(() => {
      axios(url)
      .then(res => console.log(res.data))
    }, [])

  return (
    DentistState
  )
}

export default Context
